//{{{  net primitives

//{{{  activations

function relu(x) {
  return Math.max(0, x);
}

function crelu(x) {
  return Math.min(Math.max(x, 0), NET_QA);
}

function screlu(x) {
  const y = Math.min(Math.max(x, 0), NET_QA);
  return y * y;
}

function sqrrelu(x) {
  const y = Math.max(0, x);
  return y * y;
}

